import React from 'react';
import { Card } from '../components/Card'
import { useSelector } from 'react-redux'


export const CardContainer = () => {
    const states = useSelector(reducer => reducer.objectiveState)
    const clock = useSelector(reducer => reducer.clockState)
    return (
        <div className="container">
            {Object.keys(states.timers).length === 0 ? <h1>No Timers are active.</h1> : states.timers.filter(timer => clock.time - timer.start > 0 && timer.end - clock.time > 0).map(timer => <Card timer={timer} />)}

